window.bookSummaryJSON = "<p><b>Three hot couples. Eleven alluring guests. One island of tricks and treats.</b></p> <p>I love Halloween so much it's scary. After a heartbreaking year, I need some candy, role-play, and wicked thrills. So why not turn one spell-binding night into a week of forbidden fun?</p> <p>Fortunately for me, my husband thirsts for my spooktacular plans. So do our partners, our paramours, our sixsome of love and laughs. We're known for our holidays, and with eleven of our friends coming, this one is sure to have lots of bumps in the night. Just how far will we go to thrill each other?</p> <p>Most think I, little Eily Van de May, am too cute to spook, but I've found a secret villain who'll help me deliver some scream-worthy fun.</p> <p>There's only one freaky problem. Our bewitching fantasies might have conjured a haintâ€”a spooky spirit who wants to join the naughty nights.</p> <p>Was this the kind of boneyard I planned?</p> <p><i>From bestselling author Kelly Finley comes a steamy rom-com of forced proximity and found family in this interconnected standalone. Featuring the six MCs and their friends you can't get enough of, this friends-to-lovers romance will trick your treats.</i></p>"; 
